# 1 "TransLex.fsl"
 
module TransLex

open Microsoft.FSharp.Text.Lexing
open TransPar

let lexemeAsString lexbuf =
    LexBuffer<char>.LexemeString lexbuf

let commentStart = ref Position.Empty;
let commentDepth = ref 0;

(* Distinguish keywords from identifiers *)
let keyword s =
    match s with
    | "if" -> IF
    | "else" -> ELSE
    | "break" -> BREAK
    | "do" -> DO
    | "while" -> WHILE
    | "lock" -> LOCK
    | "unlock" -> UNLOCK
    | "for" -> FOR
    | "in" -> IN
    | "wait" -> WAIT
    | "when" -> WHEN
    | "then" -> THEN
    | "var" -> VAR
    | "fun" -> FUN
    | "true" -> CSTBOOL true
    | "false" -> CSTBOOL false
    | "on" -> ON
    | "preserve" -> PRESERVE
    | "struct" -> STRUCT
    | "return" -> RETURN
    | "local" -> LOCAL
    | "global" -> GLOBAL
    | _ -> NAME s

let cEscape s = 
    match s with 
    | "\\\\" -> '\\'
    | "\\\"" -> '\"'
    | "\\a"  -> '\007'
    | "\\b"  -> '\008'
    | "\\t"  -> '\t'
    | "\\n"  -> '\n'
    | "\\v"  -> '\011'
    | "\\f"  -> '\012'
    | "\\r"  -> '\r'
    | _      -> failwith "Lexer error: impossible C escape"

